import React from "react";
import Button from "../Components/Button";

const Dashboard = () => {
  return (
    <>
      <div className="px-10 w-full space-between">
        <div className=" md:flex items-center ">
          <img src="/images/logo.png" className="w-20 inline-block"></img>
          <h2 className="inline text-3xl font-semibold">Homeoz</h2>
          <div className="flex sm:w-5rem ">
            <Button text="Hi, Rajnish" />
            <div className="w-5 h-10"></div>
            <Button text="LogOut" />
          </div>
        </div>
      </div>
    </>
  );
};

export default Dashboard;
